import React, {Component} from "react";
import {Button, Col, Container, Form} from "react-bootstrap";
import './Profile_Details.css';


class CreateEditButton extends Component
{

        render(){

          return (              
          <Container fluid style={{paddingLeft:'0rem', paddingRight:'0rem'}}>             
            <Button id="pButton " type="submit" value="Submit" style={{ marginBottom: '5%' }}>
                 Edit
            </Button>
          </Container>
            
            );
    }
  } 
         



export default CreateEditButton;
